import './PullDown.css';
const { Position } = require("../../../../../../DB/Position")


export const PullDownMember = (props) => {
    console.log(props.battingOrder)

    return (
        <div className="PullDown">

            <ul id="dropmenu">
                {/* 先行チーム */}
                {props.nowIningState[1] === 0 &&
                    <>
                        <li className='cannotTouchLi'><a className='cannotTouchA' href="#">打者</a></li>
                        <li><a href="#">{props.battingOrder[0].player_name_kanji}</a>
                            <ul>
                                {props.registeredMember1.map((registeredMember1) => {
                                    <li><a href="#">{registeredMember1.player_name_kanji}</a>
                                        <ul>
                                            <li><a href="#">代打</a></li>
                                        </ul>
                                    </li>
                                    return (
                                        <>
                                            <li><a href="#">{registeredMember1.player_name_kanji}</a></li>
                                        </>
                                    )
                                })}
                            </ul>
                        </li>
                        <li className='cannotTouchLi'><a className='cannotTouchA' href="#">投手</a></li>
                        <li><a href="#">投手側</a>
                            <ul>
                                <li><a href="#">アウト</a></li>
                                <li><a href="#">エラー</a></li>
                                <li><a href="#">ホームラン</a></li>
                                <li><a href="#">バント</a></li>
                            </ul>
                        </li>
                    </>
                }

                {props.nowIningState[1] === 1 &&
                    <>
                        {/* 高校チーム */}
                        <li className='cannotTouchLi'><a className='cannotTouchA' href="#">打者</a></li>
                        <li><a href="#">{props.battingOrder[0].player_name_kanji}</a>
                            <ul>
                                {props.registeredMember2.map((registeredMember2) => {
                                    return (
                                        <>
                                            <li><a href="#">{registeredMember2.player_name_kanji}</a></li>
                                        </>
                                    )
                                })}
                            </ul>
                        </li>
                        <li className='cannotTouchLi'><a className='cannotTouchA' href="#">投手</a></li>
                        <li><a href="#">投手側</a>
                            <ul>
                                <li><a href="#">ヒット</a></li>
                                <li><a href="#">アウト</a></li>
                                <li><a href="#">エラー</a></li>
                                <li><a href="#">ホームラン</a></li>
                                <li><a href="#">バント</a></li>
                            </ul>
                        </li>
                    </>
                }

            </ul>

        </div>
    );
}

export default PullDownMember;


